import React from "react";
import Video from "./Video";

const VideoList = ({ videos }) => {
  return (
    <div>
      <h2>Video List</h2>
      {videos.map((video) => (
        <Video key={video.id} video={video} />
      ))}
    </div>
  );
};

export default VideoList;
